import React from "react";

export default function Login(){


    return(
        <>
        <h1>Login  Page</h1>
        <form>
<label>Enter your name : </label>
            <input type='text'/>
            <label>Enter your password :</label>
            <input type ='password'/>

        </form>
        </>
    )
}
